import React, {Component} from 'react';
import {Nav, Navbar} from 'react-bootstrap';

class TunaNavBar extends Component {

    navigate(page) {
        console.log("tunatimes");
    }

    render() {
        return(
            <Navbar bg="light" expand="lg">
                <Navbar.Brand>Tuna</Navbar.Brand>
                    <Nav className="mr-auto">
                        <Nav.Link>Charlie Formula</Nav.Link>
                        <Nav.Link onClick={() => this.navigate('tunatimes')}>Tuna Times</Nav.Link>
                    </Nav>
            </Navbar>
        )
    }
}

export default TunaNavBar;
